import React from 'react';
import FiltroNumerico from './FiltrosTabela';

class Headers extends React.Component {
  render() {
    return (
      <div>
        <div>
          <FiltroNumerico />
        </div>
        <thead>
          <tr>
            <t>{name}</t>
            <t>{rotation_period}</t>
            <t>{orbital_period}</t>
            <t>{diameter}</t>
            <t>{climate}</t>
            <t>{gravity}</t>
            <t>{terrain}</t>
            <t>{surface_water}</t>
            <t>{population}</t>
            <t>{films}</t>
            <t>{created}</t>
            <t>{edited}</t>
            <t>{url}</t>
          </tr>
        </thead>
      </div>
    );
  }
}

export default Headers;
